import Link from 'next/link'

const Navbar = () => (
    <div>
        <nav className="navbar navbar-dark bg-dark">
            <a className="navbar-brand" href="#">Navbar</a>
            <span>Manda Kadam</span>
        </nav>
    </div>
)

export default Navbar;
